import React from "react";
import Manager from "./Manager";

export default function MainManager() {
  return (
    <div style={{ display: "flex", justifyContent: "space-between" }}>
      <div
        style={{
          backgroundColor: "#343a40",
          width: "12%",
          textAlign: "center",
          height
        }}
      >
        <h1>Go home</h1>
        <hr />
        <h1>Manager</h1>
        <div>
          <h1>Manager</h1>
        </div>
      </div>
      <div>
        <Manager />
      </div>
    </div>
  );
}
